import React, { useEffect, useRef, useState } from 'react';
import io from 'socket.io-client';
import '../Room.css';

const socket = io.connect('https://localhost:5000'); // Change to your server URL if needed

const GuestRoom = () => {
  const [joined, setJoined] = useState(false);
  const [participants, setParticipants] = useState([]);
  const [name, setName] = useState('');
  const [roomId, setRoomId] = useState('');
  const [stream, setStream] = useState(null);
  const [videoEnabled, setVideoEnabled] = useState(true);
  const [audioEnabled, setAudioEnabled] = useState(true);

  const localVideoRef = useRef();
  const peersRef = useRef({});
  const videoGridRef = useRef();

  useEffect(() => {
    socket.on('all-users', users => {
      setParticipants(users);
    });

    socket.on('user-joined', ({ userId, name }) => {
      setParticipants(prev => [...prev, { id: userId, name }]);
    });

    socket.on('user-left', userId => {
      setParticipants(prev => prev.filter(user => user.id !== userId));
      if (peersRef.current[userId]) {
        peersRef.current[userId].remove();
        delete peersRef.current[userId];
      }
    });
  }, []);

  const handleJoin = async () => {
    try {
      const userStream = await navigator.mediaDevices.getUserMedia({ video: true, audio: true });
      setStream(userStream);
      setJoined(true);
      socket.emit('join-room', { roomId, name });

      if (localVideoRef.current) {
        localVideoRef.current.srcObject = userStream;
      }
    } catch (err) {
      console.error('Error accessing media devices.', err);
    }
  };

  const toggleVideo = () => {
    stream.getVideoTracks().forEach(track => {
      track.enabled = !track.enabled;
    });
    setVideoEnabled(!videoEnabled);
  };

  const toggleAudio = () => {
    stream.getAudioTracks().forEach(track => {
      track.enabled = !track.enabled;
    });
    setAudioEnabled(!audioEnabled);
  };

  const handleLeave = () => {
    socket.emit('leave-room', { roomId });
    window.location.reload();
  };

  if (!joined) {
    return (
      <div className="room-container">
        <div className="side-panel">
          <h3>Join Ve Meet</h3>
          <input placeholder="Your Name" value={name} onChange={e => setName(e.target.value)} />
          <input placeholder="Room Code" value={roomId} onChange={e => setRoomId(e.target.value)} />
          <button onClick={handleJoin}>Join</button>
        </div>
      </div>
    );
  }

  return (
    <div className="room-container">
      <div className="video-grid" ref={videoGridRef}>
        <div className="video-block">
          <video className="video" ref={localVideoRef} autoPlay muted playsInline />
          <div className="video-name">{name} (You)</div>
        </div>
        {participants.map(participant => (
          <div key={participant.id} className="video-block">
            <video className="video" autoPlay playsInline />
            <div className="video-name">{participant.name}</div>
          </div>
        ))}
      </div>
      <div className="side-panel">
        <h3>Participants ({participants.length + 1})</h3>
        <ul>
          <li>{name} (You)</li>
          {participants.map(p => (
            <li key={p.id}>{p.name}</li>
          ))}
        </ul>
        <div className="controls">
          <button onClick={toggleAudio}>{audioEnabled ? 'Mute' : 'Unmute'}</button>
          <button onClick={toggleVideo}>{videoEnabled ? 'Video Off' : 'Video On'}</button>
          <button className="end" onClick={handleLeave}>Leave Meeting</button>
        </div>
      </div>
    </div>
  );
};

export default GuestRoom;
